// src/Register.js
import React, { useState } from 'react';
import { Button, Form, Row, Col, Container, InputGroup } from 'react-bootstrap';
import * as formik from 'formik';
import * as yup from 'yup';

function Register() {
    const { Formik } = formik;
    const schema = yup.object().shape({
        ime: yup.string().required(),
        prezime: yup.string().required(),
        oib: yup.string().required(),
        email: yup.string().required(),
        lozinka: yup.string().required(),
    });

    const [name, setName] = useState('');
    const [surname, setSurname] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [oib, setOib] = useState('');
    const handleRegister = () => {
        // Add your registration logic here
        console.log({ name, surname, email, password, oib });
    };

    return (
        <Formik
            validationSchema={schema}
            onSubmit={console.log}
            initialValues={{
                firstName: 'Mark',
                lastName: 'Otto',
                username: '',
                city: '',
                state: '',
                zip: '',
                terms: false,
            }}
        >


            <Container className="justify-content-md-center">
                <Form >
                    <Col>
                        <Row className="justify-content-md-center">
                            <Col xs={3}>
                                <Form.Group className="mb-3" controlId="formBasicName">
                                    <Form.Label>Ime</Form.Label>
                                    <Form.Control
                                        type="text"
                                        placeholder="Unesite ime"
                                        value={name}
                                        onChange={(e) => setName(e.target.value)}
                                    />
                                </Form.Group>
                            </Col>
                            <Col xs={3}>
                                <Form.Group className="mb-3" controlId="formBasicSurname">
                                    <Form.Label>Prezime</Form.Label>
                                    <Form.Control
                                        type="text"
                                        placeholder="Unesite prezime"
                                        value={surname}
                                        onChange={(e) => setSurname(e.target.value)}
                                    />
                                </Form.Group>
                            </Col>
                        </Row>
                        <Row className="justify-content-md-center">
                            <Col xs={6}>
                                <Form.Group className="mb-3" controlId="formBasicOib">
                                    <Form.Label>OIB</Form.Label>
                                    <Form.Control
                                        type="text"
                                        placeholder="Unesite OIB"
                                        value={oib}
                                        onChange={(e) => setOib(e.target.value)}
                                    />
                                </Form.Group>
                            </Col>
                        </Row>
                        <Row className="justify-content-md-center">
                            <Col xs={6}>
                                <Form.Group className="mb-3" controlId="formBasicEmail">
                                    <Form.Label>Email adresa</Form.Label>
                                    <Form.Control
                                        type="email"
                                        placeholder="Unesite email"
                                        value={email}
                                        onChange={(e) => setEmail(e.target.value)}
                                    />
                                </Form.Group>
                            </Col>
                        </Row>
                        <Row className="justify-content-md-center">
                            <Col xs={6}>
                                <Form.Group className="mb-3" controlId="formBasicPassword">
                                    <Form.Label>Lozinka</Form.Label>
                                    <Form.Control
                                        type="password"
                                        placeholder="Unesite lozinku"
                                        value={password}
                                        onChange={(e) => setPassword(e.target.value)}
                                    />
                                </Form.Group>
                            </Col>
                        </Row>
                        <Row className="justify-content-md-center">
                            <Col xs={2}>
                                <Button variant="primary" type="button" onClick={handleRegister}>
                                    Registriraj se
                                </Button>
                            </Col>
                        </Row>
                    </Col>
                </Form>
            </Container>
        </Formik>
    );
}

export default Register;
